import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  flex: 1;
  height: ${window.innerHeight - 210}px;
  position: relative;
  background: blue;
`;

export const Painel = styled.div`
  height: 130px;
  width: 100%;
  background: #fff;
  position: fixed;
  top: 0;
  left: 0;
  background: red;
`;
